import { useState } from 'react';
import './App.css';

function App() {

  const [logado, setLogado] = useState(false);
  return (
    <div className="App">
      <h1>Chat</h1>
      {!logado ? "Necessário realizar o login" : "Logado"}
    </div>
  );
}

export default App;
